import { useSelector, useDispatch } from "react-redux";
import { Button, Tab, Tabs, Badge, Col, Row } from "react-bootstrap";
import classes from "./Favorites.module.css";
import styles from "../components/Table.module.css";
import classesB from "../components/RowTableBooking.module.css";
import { favoritesActions } from "../store";

const Favorites = () => {
  const favorites = useSelector((state) => state.favorites.favorites);
  const dispatch = useDispatch();

  const flights = favorites.filter((obj) => {
    return obj.type === "flight";
  });

  const buses = favorites.filter((obj) => {
    return obj.type === "bus";
  });

  const rooms = favorites.filter((obj) => {
    return obj.type === "rooms";
  });

  const rentals = favorites.filter((obj) => {
    return obj.type === "rental";
  });

  return (
    <div className={classes.favorites}>
      <div>
        <h2>YOUR FAVORITES LIST</h2>
        <h4>Check list of your saved offers.</h4>
      </div>
      <div className={classes.tabs}>
        <Tabs defaultActiveKey="profile" id="12345" className="mb-3" justify>
          <Tab eventKey="flights" title="Flights">
            <div className={styles.tableFav}>
              {flights.length === 0 ? (
                <p>Flights list is empty.</p>
              ) : (
                flights.map((el) => {
                  return (
                    <div className={styles.row}>
                      <div className={styles.column_text}>
                        <span>{el.departureDate}</span>
                      </div>
                      <div className={styles.column_text}>
                        <span>{el.depTime}h</span>
                        <span>
                          {el.airportFrom.iata} | {el.airportFrom.name}
                        </span>
                      </div>
                      <div className={styles.column_text}>
                        <span>{el.arrivalTime}h</span>
                        <span>
                          {el.airportTo.iata} | {el.airportTo.name}
                        </span>
                      </div>
                      <div className={styles.column_text}>
                        <span>Flight number:</span>
                        <span>{el.number}</span>
                      </div>
                      <div className={styles.column_text}>
                        <span>Operator:</span>
                        <span>{el.operator}</span>
                      </div>
                      <div>
                        <Button
                          type="button"
                          variant="danger"
                          onClick={() => {
                            const indx = favorites.indexOf(el);
                            console.log(indx);
                            dispatch(
                              favoritesActions.removeFromFavorites({
                                index: indx,
                              })
                            );
                          }}
                        >
                          <svg
                            xmlns="http://www.w3.org/2000/svg"
                            width="26"
                            height="26"
                            fill="currentColor"
                            class="bi bi-trash"
                            viewBox="0 0 16 16"
                          >
                            <path d="M5.5 5.5A.5.5 0 0 1 6 6v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5Zm2.5 0a.5.5 0 0 1 .5.5v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5Zm3 .5a.5.5 0 0 0-1 0v6a.5.5 0 0 0 1 0V6Z" />
                            <path d="M14.5 3a1 1 0 0 1-1 1H13v9a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2V4h-.5a1 1 0 0 1-1-1V2a1 1 0 0 1 1-1H6a1 1 0 0 1 1-1h2a1 1 0 0 1 1 1h3.5a1 1 0 0 1 1 1v1ZM4.118 4 4 4.059V13a1 1 0 0 0 1 1h6a1 1 0 0 0 1-1V4.059L11.882 4H4.118ZM2.5 3h11V2h-11v1Z" />
                          </svg>
                        </Button>
                      </div>
                    </div>
                  );
                })
              )}
            </div>
          </Tab>
          <Tab eventKey="bus" title="Bus">
            <div className={styles.tableFav}>
              {buses.length === 0 ? (
                <p>Bus list is empty.</p>
              ) : (
                buses.map((el) => {
                  return (
                    <div className={styles.row}>
                      <div className={styles.column_text}>
                        <span>{el.departure}h</span>
                        <span>{el.from}</span>
                      </div>
                      <div className={styles.column_text}>
                        <span>Duration</span>
                        <span>{el.duration}h</span>
                      </div>
                      <div className={styles.column_text}>
                        <span>{el.arrival}h</span>
                        <span>{el.to}</span>
                      </div>
                      <div className={styles.column_text}>
                        <span>Operator</span>
                        <span>{el.operator}</span>
                      </div>
                      <div className={styles.column_text}>
                        <span>Price</span>
                        <span>{el.price} €</span>
                      </div>
                      <div>
                        <Button
                          type="button"
                          variant="danger"
                          onClick={() => {
                            const indx = favorites.indexOf(el);
                            console.log(indx);
                            dispatch(
                              favoritesActions.removeFromFavorites({
                                index: indx,
                              })
                            );
                          }}
                        >
                          <svg
                            xmlns="http://www.w3.org/2000/svg"
                            width="26"
                            height="26"
                            fill="currentColor"
                            class="bi bi-trash"
                            viewBox="0 0 16 16"
                          >
                            <path d="M5.5 5.5A.5.5 0 0 1 6 6v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5Zm2.5 0a.5.5 0 0 1 .5.5v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5Zm3 .5a.5.5 0 0 0-1 0v6a.5.5 0 0 0 1 0V6Z" />
                            <path d="M14.5 3a1 1 0 0 1-1 1H13v9a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2V4h-.5a1 1 0 0 1-1-1V2a1 1 0 0 1 1-1H6a1 1 0 0 1 1-1h2a1 1 0 0 1 1 1h3.5a1 1 0 0 1 1 1v1ZM4.118 4 4 4.059V13a1 1 0 0 0 1 1h6a1 1 0 0 0 1-1V4.059L11.882 4H4.118ZM2.5 3h11V2h-11v1Z" />
                          </svg>
                        </Button>
                      </div>
                    </div>
                  );
                })
              )}
            </div>
          </Tab>
          <Tab eventKey="rooms" title="Rooms">
            <div className={styles.tableFav}>
              {rooms.length === 0 ? (
                <p>Rooms list is empty.</p>
              ) : (
                rooms.map((el) => {
                  return (
                    <div className={classesB.row}>
                      <Row className={classesB.align}>
                        <Col xs={5}>
                          <h4 className={classesB.colorBlue}>{el.name}</h4>
                          <p>{el.city}</p>
                          <p>{el.address}</p>
                          <a href={el.url} target="_blank">
                            Link to official page
                          </a>
                        </Col>

                        <Col>
                          <span>
                            Adults: {el.adults}, children: {el.children}
                          </span>
                          <p>-------------</p>
                          <h3 className={classesB.colorBlue}>{el.price}€</h3>
                        </Col>
                        <Col>
                          <h3 className={classesB.colorBlue}>
                            {el.reviewWord}
                          </h3>
                          <h1>
                            <Badge bg="primary">{el.review}</Badge>
                          </h1>
                          {el.reviewWord === "" && (
                            <Badge bg="warning" text="dark">
                              New on web
                            </Badge>
                          )}
                        </Col>

                        <Col>
                          <Button
                            type="button"
                            variant="danger"
                            onClick={() => {
                              const indx = favorites.indexOf(el);
                              console.log(indx);
                              dispatch(
                                favoritesActions.removeFromFavorites({
                                  index: indx,
                                })
                              );
                            }}
                          >
                            <svg
                              xmlns="http://www.w3.org/2000/svg"
                              width="26"
                              height="26"
                              fill="currentColor"
                              class="bi bi-trash"
                              viewBox="0 0 16 16"
                            >
                              <path d="M5.5 5.5A.5.5 0 0 1 6 6v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5Zm2.5 0a.5.5 0 0 1 .5.5v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5Zm3 .5a.5.5 0 0 0-1 0v6a.5.5 0 0 0 1 0V6Z" />
                              <path d="M14.5 3a1 1 0 0 1-1 1H13v9a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2V4h-.5a1 1 0 0 1-1-1V2a1 1 0 0 1 1-1H6a1 1 0 0 1 1-1h2a1 1 0 0 1 1 1h3.5a1 1 0 0 1 1 1v1ZM4.118 4 4 4.059V13a1 1 0 0 0 1 1h6a1 1 0 0 0 1-1V4.059L11.882 4H4.118ZM2.5 3h11V2h-11v1Z" />
                            </svg>
                          </Button>
                        </Col>
                      </Row>
                    </div>
                  );
                })
              )}
            </div>
          </Tab>
          <Tab eventKey="rental" title="Rent-a-car">
            <div className={styles.tableFav}>
              {rentals.length === 0 ? (
                <p>Rent-a-car list is empty.</p>
              ) : (
                rentals.map((el) => {
                  return (
                    <div className={classesB.row}>
                      <Row className={classesB.align}>
                        <Col xs={5}>
                          <h4 className={classesB.colorBlue}>{el.name}</h4>
                          <p>{el.city}</p>
                          <p>{el.address}</p>
                          <a href={el.url} target="_blank">
                            Link to official page
                          </a>
                        </Col>

                        <Col>
                          <span>
                            Adults: {el.adults}, children: {el.children}
                          </span>
                          <p>-------------</p>
                          <h3 className={classesB.colorBlue}>{el.price}€</h3>
                        </Col>
                        <Col>
                          <h3 className={classesB.colorBlue}>
                            {el.reviewWord}
                          </h3>
                          <h1>
                            <Badge bg="primary">{el.review}</Badge>
                          </h1>
                          {el.reviewWord === "" && (
                            <Badge bg="warning" text="dark">
                              New on web
                            </Badge>
                          )}
                        </Col>

                        <Col>
                          <Button
                            type="button"
                            variant="danger"
                            onClick={() => {
                              const indx = favorites.indexOf(el);
                              console.log(indx);
                              dispatch(
                                favoritesActions.removeFromFavorites({
                                  index: indx,
                                })
                              );
                            }}
                          >
                            <svg
                              xmlns="http://www.w3.org/2000/svg"
                              width="26"
                              height="26"
                              fill="currentColor"
                              class="bi bi-trash"
                              viewBox="0 0 16 16"
                            >
                              <path d="M5.5 5.5A.5.5 0 0 1 6 6v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5Zm2.5 0a.5.5 0 0 1 .5.5v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5Zm3 .5a.5.5 0 0 0-1 0v6a.5.5 0 0 0 1 0V6Z" />
                              <path d="M14.5 3a1 1 0 0 1-1 1H13v9a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2V4h-.5a1 1 0 0 1-1-1V2a1 1 0 0 1 1-1H6a1 1 0 0 1 1-1h2a1 1 0 0 1 1 1h3.5a1 1 0 0 1 1 1v1ZM4.118 4 4 4.059V13a1 1 0 0 0 1 1h6a1 1 0 0 0 1-1V4.059L11.882 4H4.118ZM2.5 3h11V2h-11v1Z" />
                            </svg>
                          </Button>
                        </Col>
                      </Row>
                    </div>
                  );
                })
              )}
            </div>
          </Tab>
        </Tabs>
      </div>
    </div>
  );
};

export default Favorites;
